import React from 'react';
import { Box, Select, SimpleGrid } from '@chakra-ui/core';

const Filter = () => {
  return (
    <Box border="1px solid gray" borderRadius={5} p={5} mt={4} mb={4}>
      Filter will go here...
      <SimpleGrid columns={{ md: 3, xs: 1 }}></SimpleGrid>
    </Box>
  );
};

export default Filter;
